import React from 'react'
import { Link, NavLink } from 'react-router-dom'

const Navbar = () => {
  return (
    <div className="navbar">
      <div className="logo">
        Logo
      </div>

      <Link to="/todo"></Link>
    </div>
  )
}

export default Navbar
